
INSERT INTO public.query_examples VALUES (70, 'best selling product 2023', 'WITH ProductRevenue AS (
    SELECT
        p.id,
        p.name,
        SUM(op.amount) AS total_revenue
    FROM
        product2 p
    JOIN
        opportunity_product op ON p.id = op.product_id
    JOIN
        opportunities o ON op.opportunity_id = o.id
    WHERE
        o.stage = ''won''
        AND EXTRACT(YEAR FROM o.close_date) = 2023
    GROUP BY
        p.id
    ORDER BY
        total_revenue DESC
    LIMIT 1
)
SELECT
    id,
    name,
    total_revenue
FROM
    ProductRevenue;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (76, 'How many units of Awesome Concrete Car were sold in 2024?', 'SELECT SUM(op.quantity) AS units_sold
FROM product2 p
JOIN opportunity_product op ON p.id = op.product_id
JOIN opportunities o ON op.opportunity_id = o.id
WHERE p.name = ''Awesome Concrete Car''
AND o.stage = ''won''
AND EXTRACT(YEAR FROM o.close_date) = 2024;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (81, 'Top 3 popular products of 2023', 'SELECT
    p.id,
    p.name,
    COUNT(op.opportunity_id) AS total_sales,
    SUM(op.quantity) AS total_units_sold
FROM
    product2 p
JOIN
    opportunity_product op ON p.id = op.product_id
JOIN
    opportunities o ON op.opportunity_id = o.id
WHERE
    o.stage = ''won'' AND
    EXTRACT(YEAR FROM o.close_date) = 2023
GROUP BY
    p.id
ORDER BY
    total_sales DESC,
    total_units_sold DESC
LIMIT 3;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (86, 'deals closed today', 'SELECT COUNT(*) AS deals_closed_today
FROM opportunities
WHERE close_date = CURRENT_DATE AND stage = ''won'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (91, 'SELECT SUM(amount * quantity) AS total_amount FROM opportunity_products WHERE opportunity_id = 471', 'SELECT SUM(amount) AS total_amount FROM opportunity_product WHERE opportunity_id = 471;', false, NULL, NULL) ON CONFLICT DO NOTHING;
