INSERT INTO public.query_examples VALUES (95, 'top 10 items by quantity expected to sell in May', 'SELECT
    p.id AS product_id,
    p.name AS product_name,
    SUM(op.quantity) AS total_quantity
FROM
    product2 p
JOIN
    opportunity_product op ON p.id = op.product_id
JOIN
    opportunities o ON op.opportunity_id = o.id
WHERE
    o.close_date BETWEEN ''2024-05-01'' AND ''2024-05-31''
    AND o.stage NOT IN (''won'', ''lost'')
GROUP BY
    p.id
ORDER BY
