INSERT INTO public.query_examples VALUES (65, 'SELECT customer_id, year, SUM(total_spent) AS annual_spending FROM sales GROUP BY customer_id, year ORDER BY customer_id, year', 'WITH Spending2023 AS (
    SELECT
        a.id AS customer_id,
        a.name AS customer_name,
        SUM(op.amount) AS spending_2023
    FROM
        accounts a
    JOIN
        opportunities o ON a.id = o.account_id
    JOIN
        opportunity_product op ON o.id = op.opportunity_id
    WHERE
        o.stage = ''won'' AND
        EXTRACT(YEAR FROM o.close_date) = 2023
    GROUP BY
        a.id
),
Spending2024 AS (
    SELECT
        a.id AS customer_id,
        SUM(op.amount) AS spending_2024
    FROM
        accounts a
    JOIN
        opportunities o ON a.id = o.account_id
    JOIN
        opportunity_product op ON o.id = op.opportunity_id
    WHERE
        o.stage = ''won'' AND
        EXTRACT(YEAR FROM o.close_date) = 2024
    GROUP BY
        a.id
),
YoYGrowth AS (
    SELECT
        s23.customer_id,
        s23.customer_name,
        s23.spending_2023,
        COALESCE(s24.spending_2024, 0) AS spending_2024,
        CASE
            WHEN s23.spending_2023 > 0 THEN
                ROUND(((COALESCE(s24.spending_2024, 0) - s23.spending_2023) / s23.spending_2023::NUMERIC) * 100, 2)
            ELSE NULL
        END AS yoy_growth_percentage
    FROM
        Spending2023 s23
    LEFT JOIN
        Spending2024 s24 ON s23.customer_id = s24.customer_id
)
SELECT
    customer_id,
    customer_name,
    spending_2023,
    spending_2024,
    yoy_growth_percentage
FROM
    YoYGrowth
ORDER BY
    yoy_growth_percentage DESC, customer_id;
