INSERT INTO public.query_examples VALUES (66, 'yoy buyer comparison data for the latest two years', 'WITH AccountYearlyTotals AS (
    SELECT
        a.id AS account_id,
        a.name AS account_name,
        EXTRACT(YEAR FROM o.close_date) AS year,
        SUM(op.amount) AS total_spent
    FROM
        accounts a
    JOIN opportunities o ON a.id = o.account_id AND o.stage = ''won''
    JOIN opportunity_product op ON o.id = op.opportunity_id
    WHERE
        o.close_date BETWEEN (CURRENT_DATE - INTERVAL ''2 YEAR'') AND CURRENT_DATE
    GROUP BY
        a.id, account_name, year
),
YearlyComparisons AS (
    SELECT
        y1.account_id,
        y1.account_name,
        y1.total_spent AS total_spent_last_year,
        y2.total_spent AS total_spent_this_year,
        CASE
            WHEN y1.total_spent > 0 THEN (y2.total_spent - y1.total_spent) / y1.total_spent * 100
            ELSE 0
        END AS yoy_growth
    FROM
        AccountYearlyTotals y1
    FULL OUTER JOIN AccountYearlyTotals y2 ON y1.account_id = y2.account_id AND y1.year = y2.year - 1
    WHERE
        y1.year = EXTRACT(YEAR FROM CURRENT_DATE - INTERVAL ''1 YEAR'') OR
        y2.year = EXTRACT(YEAR FROM CURRENT_DATE)
)
SELECT
    account_name,
    total_spent_last_year,
    total_spent_this_year,
    yoy_growth
FROM
    YearlyComparisons;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (44, 'What is the YOY growth for Rohan, Christiansen and Wuckert?', 'WITH AccountNames AS (
    SELECT DISTINCT a.id, a.name
    FROM accounts a
    WHERE a.name = ''Rohan, Christiansen and Wuckert''
),
TotalAmount2023 AS (
    SELECT
        a.name,
        COALESCE(SUM(op.amount), 0) AS total_spent_2023
    FROM
        AccountNames a
    LEFT JOIN opportunities o ON a.id = o.account_id AND o.stage = ''win''
    AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
    LEFT JOIN opportunity_product op ON o.id = op.opportunity_id
    GROUP BY
        a.name
),
TotalAmount2024 AS (
    SELECT
        a.name,
        COALESCE(SUM(op.amount), 0) AS total_spent_2024
    FROM
        AccountNames a
    LEFT JOIN opportunities o ON a.id = o.account_id AND o.stage = ''win''
    AND o.close_date BETWEEN ''2024-01-01'' AND ''2024-12-31''
    LEFT JOIN opportunity_product op ON o.id = op.opportunity_id
    GROUP BY
        a.name
)
SELECT
    TA2023.name,
    TA2023.total_spent_2023,
    TA2024.total_spent_2024,
    CASE
        WHEN TA2023.total_spent_2023 > 0 THEN
            (TA2024.total_spent_2024 - TA2023.total_spent_2023) / TA2023.total_spent_2023 * 100
        ELSE NULL
    END AS yoy_growth_percentage
FROM
    TotalAmount2023 TA2023
LEFT JOIN TotalAmount2024 TA2024 ON TA2023.name = TA2024.name;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (71, 'quantity sold of Bespoke Metal Ball in 2023', 'SELECT SUM(op.quantity) AS quantity_sold
FROM opportunity_product op
JOIN opportunities o ON op.opportunity_id = o.id
JOIN product2 p ON op.product_id = p.id
WHERE p.name = ''Bespoke Metal Ball''
AND o.stage = ''won''
AND EXTRACT(YEAR FROM o.close_date) = 2023;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (50, 'Can you compare avreage deal size between the win and lost deals?', 'WITH DealSizes AS (
    SELECT
        stage,
        AVG(amount) AS avg_deal_size
    FROM opportunities o
    JOIN opportunity_product op ON o.id = op.opportunity_id
    WHERE stage IN (''won'', ''lost'')
    GROUP BY stage
)
SELECT
    ''win'' AS stage,
    COALESCE((SELECT avg_deal_size FROM DealSizes WHERE stage = ''won''), 0) AS avg_win_deal_size,
    ''lost'' AS stage,
    COALESCE((SELECT avg_deal_size FROM DealSizes WHERE stage = ''lost''), 0) AS avg_lost_deal_size
