INSERT INTO public.query_examples VALUES (40, 'Who is the our largest spending customer?', 'SELECT a.id, a.name, SUM(op.amount) AS total_spent
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.stage =''win''
GROUP BY a.id
ORDER BY total_spent DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (72, 'best selling product in 2024', 'WITH ProductSales AS (
    SELECT
        p.id,
        p.name,
        SUM(op.quantity * op.amount) AS total_sales
    FROM
        product2 p
    JOIN
        opportunity_product op ON p.id = op.product_id
    JOIN
        opportunities o ON op.opportunity_id = o.id
    WHERE
        EXTRACT(YEAR FROM o.close_date) = 2024 AND o.stage = ''won''
    GROUP BY
        p.id
)
SELECT
    id,
    name,
    total_sales
FROM
    ProductSales
ORDER BY
    total_sales DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (42, 'Who is the our largest spending customer?', 'SELECT a.id, a.name, SUM(op.amount) AS total_spent
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.stage = ''win''
GROUP BY a.id
ORDER BY total_spent DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (77, 'SELECT customer_name, SUM(quantity) AS total_quantity FROM sales WHERE product_name = ''Awesome Concrete Car'' GROUP BY customer_name ORDER BY total_quantity DESC LIMIT 1', 'SELECT a.name, SUM(op.quantity) AS total_quantity_purchased
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
JOIN product2 p ON op.product_id = p.id
WHERE p.name = ''Recycled Wooden Car''
AND o.stage = ''won''
GROUP BY a.name
ORDER BY total_quantity_purchased DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (47, 'Can you tell me the average deal size?', 'SELECT AVG(op.amount) AS average_deal_size
FROM opportunities o
JOIN opportunity_product op ON o.id = op.opportunity_id;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (82, 'SELECT AVG(deal_size) AS average_deal_size FROM sales WHERE customer_name = ''Langworth, Wuckert, and Macejkovic''', 'SELECT AVG(op.amount) AS average_deal_size
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE a.name = ''Langworth, Wuckert, and Macejkovic'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (84, 'SELECT AVG(deal_size) AS average_deal_size FROM sales WHERE customer_name = ''Langworth, Wuckert, and Macejkovic''', 'SELECT AVG(op.amount) AS average_deal_size
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE a.name = ''Langworth, Wuckert, and Macejkovic'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (87, 'deals expected to close tomorrow', 'SELECT COUNT(*) AS deals_closing_tomorrow
FROM opportunities
WHERE close_date = CURRENT_DATE + INTERVAL ''1 day''
AND stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (92, 'count deals close this month', 'SELECT COUNT(*) AS deals_closing_this_month
FROM opportunities
WHERE close_date >= ''2024-03-01'' AND close_date <= ''2024-03-31''
AND stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
