INSERT INTO public.query_examples VALUES (46, 'What is win rate with account Rohan, Christiansen and Wuckert?', 'WITH AccountWinLoseData AS (
    SELECT
        a.id,
        COUNT(CASE WHEN o.stage = ''won'' THEN 1 END) AS wins,
        COUNT(CASE WHEN o.stage = ''lost'' THEN 1 END) AS loses
    FROM
        accounts a
    LEFT JOIN opportunities o ON a.id = o.account_id
    WHERE
        a.name LIKE ''%Rohan, Christiansen and Wuckert%''
    GROUP BY
        a.id
)
SELECT
    a.id,
    a.name,
    COALESCE(wins, 0) AS total_wins,
    COALESCE(loses, 0) AS total_loses,
    CASE
        WHEN wins + loses > 0 THEN
            (CAST(wins AS DECIMAL) / (wins + loses)) * 100
        ELSE 0
    END AS win_rate_percentage
FROM
    AccountWinLoseData awl
JOIN
