INSERT INTO public.query_examples VALUES (51, 'Can you compare avreage deal size between the win and lost deals?', 'WITH DealSizeStats AS (
    SELECT
        stage,
        AVG(op.amount) AS average_deal_size
    FROM opportunities o
    JOIN opportunity_product op ON o.id = op.opportunity_id
    WHERE stage IN (''won'', ''lost'')
    GROUP BY stage
)
SELECT
    (SELECT average_deal_size FROM DealSizeStats WHERE stage = ''won'') AS average_won_deal_size,
    (SELECT average_deal_size FROM DealSizeStats WHERE stage = ''lost'') AS average_lost_deal_size;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (48, 'Who give us the most orders?', 'SELECT a.id, a.name, COUNT(*) AS total_orders
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
WHERE o.stage = ''won''
GROUP BY a.id
ORDER BY total_orders DESC
