INSERT INTO public.query_examples VALUES (52, 'Can you compare avreage deal size between the win and lost deals?', 'WITH DealSizes AS (
    SELECT
        stage,
        AVG(amount) AS avg_deal_size
    FROM opportunities o
    JOIN opportunity_product op ON o.id = op.opportunity_id
    WHERE stage IN (''won'', ''lost'')
    GROUP BY stage
)
SELECT
    (SELECT avg_deal_size FROM DealSizes WHERE stage = ''won'') AS avg_win_deal_size,
    (SELECT avg_deal_size FROM DealSizes WHERE stage = ''lost'') AS avg_lost_deal_size;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (53, 'give me the total value of won versus lost deals', 'SELECT
    SUM(CASE WHEN o.stage = ''won'' THEN op.amount ELSE 0 END) AS total_value_won,
    SUM(CASE WHEN o.stage = ''lost'' THEN op.amount ELSE 0 END) AS total_value_lost
FROM opportunities o
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.stage IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (54, 'What is our most popular product', 'SELECT p.name, SUM(op.quantity) AS total_quantity_sold
FROM opportunity_product op
JOIN product2 p ON op.product_id = p.id
GROUP BY p.id, p.name
ORDER BY total_quantity_sold DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (55, 'Which product is our top revenue generator?', 'SELECT op.product_id, SUM(op.amount) AS total_revenue
FROM opportunity_product op
JOIN opportunities o ON op.opportunity_id = o.id
WHERE o.stage = ''won''
GROUP BY op.product_id
ORDER BY total_revenue DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (56, 'Which product is our top revenue generator?', 'SELECT p.id, p.name, SUM(op.amount) AS total_revenue
FROM product2 p
JOIN opportunity_product op ON p.id = op.product_id
JOIN opportunities o ON op.opportunity_id = o.id
WHERE o.stage = ''won''
GROUP BY p.id
ORDER BY total_revenue DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (59, 'Which products generate more then 80% of our total revenue in 2023?', 'WITH total_revenue AS (
    SELECT SUM(op.amount) AS total
    FROM opportunity_product op
    JOIN opportunities o ON op.opportunity_id = o.id
    WHERE o.stage = ''won'' AND o.close_date >= ''2023-01-01'' AND o.close_date < ''2024-01-01''
),
revenue_per_product AS (
    SELECT p.id, p.name, SUM(op.amount) AS product_revenue
    FROM product2 p
    JOIN opportunity_product op ON p.id = op.product_id
    JOIN opportunities o ON op.opportunity_id = o.id
    WHERE o.stage = ''won'' AND o.close_date >= ''2023-01-01'' AND o.close_date < ''2024-01-01''
    GROUP BY p.id
)
SELECT p.id, p.name, p.product_revenue, (p.product_revenue / tr.total * 100) AS revenue_percentage
FROM revenue_per_product p
CROSS JOIN total_revenue tr
WHERE (p.product_revenue / tr.total) > 0.8;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (67, 'best selling product in 2023', 'SELECT p.id AS product_id,
       p.name AS product_name,
       SUM(op.amount) AS total_revenue
FROM opportunity_product op
JOIN product2 p ON op.product_id = p.id
JOIN opportunities o ON op.opportunity_id = o.id
WHERE o.stage = ''won''
  AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
GROUP BY p.id
ORDER BY total_revenue DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
