INSERT INTO public.query_examples VALUES (58, 'Which customer purchase the most Recycled Wooden Car', 'SELECT a.id, a.name, SUM(op.quantity) AS total_quantity_purchased
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
JOIN product2 p ON op.product_id = p.id
WHERE p.name = ''Recycled Wooden Car''
AND o.stage = ''won''
GROUP BY a.id
ORDER BY total_quantity_purchased DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (73, 'best selling product in 2023 by quantity', 'SELECT
    p.id AS product_id,
    p.name AS product_name,
    SUM(op.quantity) AS total_quantity_sold
FROM
    product2 p
JOIN
    opportunity_product op ON p.id = op.product_id
JOIN
    opportunities o ON op.opportunity_id = o.id
WHERE
    o.stage = ''won''
    AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
GROUP BY
    p.id
ORDER BY
    total_quantity_sold DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (78, 'SELECT contact FROM customers WHERE company_name = ''Rohan, Christiansen and Wuckert''', 'SELECT c.first_name, c.last_name, c.email, c.phone, c.job_title
FROM contacts c
JOIN accounts a ON c.account_id = a.id
WHERE a.name = ''Rohan, Christiansen and Wuckert'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (62, 'as 80 20 rules, what are the products that give us 80% revenue in 2023?', 'WITH Revenue AS (
    SELECT
        p.id,
        p.name,
        SUM(op.amount) AS product_revenue
    FROM product2 p
    JOIN opportunity_product op ON p.id = op.product_id
    JOIN opportunities o ON op.opportunity_id = o.id
    WHERE o.stage = ''won''
      AND o.close_date >= ''2023-01-01'' AND o.close_date <= ''2023-12-31''
    GROUP BY p.id
),
TotalRevenue AS (
    SELECT SUM(product_revenue) AS total_revenue FROM Revenue
),
CumulativeRevenue AS (
    SELECT
        R.*,
        SUM(R.product_revenue) OVER (ORDER BY R.product_revenue DESC) AS cumulative_revenue
    FROM Revenue R, TotalRevenue TR
)
SELECT
    CR.id,
    CR.name,
    CR.product_revenue,
    CR.cumulative_revenue,
    (CR.cumulative_revenue / TR.total_revenue) AS cumulative_percentage
FROM CumulativeRevenue CR, TotalRevenue TR
WHERE (CR.cumulative_revenue / TR.total_revenue) <= 0.8
ORDER BY CR.cumulative_revenue DESC;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (60, 'as 80 20 rules, what are the products that give us 80% revenue in 2023?', 'WITH TotalRevenue AS (
    SELECT SUM(amount) AS total_revenue
    FROM opportunity_product op
    JOIN opportunities o ON op.opportunity_id = o.id
    WHERE EXTRACT(YEAR FROM o.close_date) = 2023 AND o.stage = ''won''
),
ProductRevenue AS (
    SELECT p.id,
           p.name,
           SUM(op.amount) AS revenue
    FROM product2 p
    JOIN opportunity_product op ON p.id = op.product_id
    JOIN opportunities o ON op.opportunity_id = o.id
    WHERE EXTRACT(YEAR FROM o.close_date) = 2023 AND o.stage = ''won''
    GROUP BY p.id
),
CumulativeRevenue AS (
    SELECT p.id,
           p.name,
           p.revenue,
           SUM(p.revenue) OVER (ORDER BY p.revenue DESC) AS cumulative_revenue
    FROM ProductRevenue p
),
CumulativePercentage AS (
    SELECT c.id,
           c.name,
           c.revenue,
		  ROUND((c.revenue::NUMERIC / t.total_revenue) * 100, 2) AS percentage_to_total_revenue,
           c.cumulative_revenue,
           c.cumulative_revenue / t.total_revenue AS cumulative_percentage
    FROM CumulativeRevenue c, TotalRevenue t
)
SELECT id, name, revenue, percentage_to_total_revenue, t.total_revenue
FROM CumulativePercentage, TotalRevenue as t
