INSERT INTO public.query_examples VALUES (68, 'What is the quantity sold of the best selling product in 2023?', 'WITH ProductSales AS (
    SELECT
        p.id AS product_id,
        SUM(op.quantity) AS total_quantity
    FROM
        product2 p
    JOIN
        opportunity_product op ON p.id = op.product_id
    JOIN
        opportunities o ON op.opportunity_id = o.id
    WHERE
        o.stage = ''won''
        AND EXTRACT(YEAR FROM o.close_date) = 2023
    GROUP BY
        p.id
    ORDER BY
        total_quantity DESC
    LIMIT 1
)
SELECT
    product_id,
    total_quantity
FROM
    ProductSales;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (74, 'best selling product in 2024', 'SELECT
    p.id,
    p.name,
    SUM(op.amount) AS total_revenue
FROM
    product2 p
JOIN
    opportunity_product op ON p.id = op.product_id
JOIN
    opportunities o ON op.opportunity_id = o.id
WHERE
    EXTRACT(YEAR FROM o.close_date) = 2024 AND o.stage = ''won''
GROUP BY
    p.id
ORDER BY
    total_revenue DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (79, 'count tables', 'SELECT COUNT(*) FROM information_schema.tables WHERE table_schema = ''public'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (63, 'Give me top 3 customer in terms of revenue and their top 3 products also in terms of revenue in 2023?', 'WITH TopCustomers AS (
    SELECT
        a.id AS account_id,
        a.name AS account_name,
        SUM(op.amount) AS total_revenue
    FROM
        accounts a
    JOIN
        opportunities o ON a.id = o.account_id
    JOIN
        opportunity_product op ON o.id = op.opportunity_id
    WHERE
        o.stage = ''won''
        AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
    GROUP BY
        a.id
    ORDER BY
        total_revenue DESC
    LIMIT 3
),
RankedProducts AS (
    SELECT
        tc.account_id,
        tc.account_name,
        tc.total_revenue,
        p.id AS product_id,
        p.name AS product_name,
        SUM(op.quantity) AS product_quantity,
        SUM(op.amount) AS product_revenue,
        RANK() OVER (PARTITION BY tc.account_id ORDER BY SUM(op.amount) DESC) AS revenue_rank
    FROM
        TopCustomers tc
    JOIN
        opportunities o ON tc.account_id = o.account_id
    JOIN
        opportunity_product op ON o.id = op.opportunity_id
    JOIN
        product2 p ON op.product_id = p.id
    WHERE
        o.stage = ''won''
        AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
    GROUP BY
        tc.account_id, tc.account_name, tc.total_revenue, p.id
)
SELECT
    account_id,
    account_name,
    total_revenue,
    product_id,
    product_name,
    product_quantity,
    product_revenue
FROM
    RankedProducts
WHERE
    revenue_rank <= 3
ORDER BY
    account_id, revenue_rank;
