INSERT INTO public.query_examples VALUES (83, 'SELECT AVG(deal_size) AS average_deal_size FROM sales WHERE customer_name = ''Leuschke, Ledner, and Batz''', 'SELECT AVG(op.amount) AS average_deal_size
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE a.name = ''Leuschke, Ledner, and Batz'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (88, 'deal expected to close tomorrow', 'SELECT COUNT(*) AS deals_closing_tomorrow
FROM opportunities
WHERE close_date = CURRENT_DATE + INTERVAL ''1 day''
AND stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (90, 'SELECT Name, Amount, Quantity FROM Opportunity WHERE Id = 471', 'SELECT o.name, op.amount, op.quantity
FROM opportunities o
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.id = 471;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (93, 'deals expected to close this month', 'SELECT COUNT(*) AS deals_closing_this_month
FROM opportunities
WHERE close_date >= ''2024-03-01'' AND close_date <= ''2024-03-31''
AND stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (97, 'opportunities expected to close today', 'SELECT COUNT(*) AS deals_closing_today
FROM opportunities
WHERE close_date = CURRENT_DATE
AND stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (69, 'best selling product in 2023', 'SELECT
  p.id,
  p.name,
  SUM(op.quantity) AS total_quantity_sold,
  SUM(op.amount) AS total_revenue
FROM
  opportunities o
JOIN opportunity_product op ON o.id = op.opportunity_id
JOIN product2 p ON op.product_id = p.id
WHERE
  o.stage = ''won''
  AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
GROUP BY
  p.id,
  p.name
ORDER BY
  total_revenue DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (64, 'Give me top 3 customer in terms of revenue and their top 3 products also in terms of revenue in 2023?', 'WITH TopCustomers AS (
    SELECT
        a.id AS account_id,
        a.name AS account_name,
        SUM(op.amount) AS total_revenue
    FROM
        accounts a
    JOIN
        opportunities o ON a.id = o.account_id
    JOIN
        opportunity_product op ON o.id = op.opportunity_id
    WHERE
        o.stage = ''won''
        AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
    GROUP BY
        a.id
    ORDER BY
        total_revenue DESC
    LIMIT 3
),
RankedProducts AS (
    SELECT
        tc.account_id,
        tc.account_name,
        tc.total_revenue,
        p.id AS product_id,
        p.name AS product_name,
        SUM(op.quantity) AS product_quantity,
        SUM(op.amount) AS product_revenue,
        RANK() OVER (PARTITION BY tc.account_id ORDER BY SUM(op.amount) DESC) AS revenue_rank
    FROM
        TopCustomers tc
    JOIN
        opportunities o ON tc.account_id = o.account_id
    JOIN
        opportunity_product op ON o.id = op.opportunity_id
    JOIN
        product2 p ON op.product_id = p.id
    WHERE
        o.stage = ''won''
        AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
    GROUP BY
        tc.account_id, tc.account_name, tc.total_revenue, p.id
)
SELECT
    account_id,
    account_name,
    total_revenue,
    product_id,
    product_name,
    product_quantity,
    product_revenue
FROM
    RankedProducts
WHERE
    revenue_rank <= 3
