INSERT INTO public.query_examples VALUES (75, 'best selling product quantity in 2024', 'SELECT p.id, p.name, SUM(op.quantity) AS total_quantity_sold
FROM product2 p
JOIN opportunity_product op ON p.id = op.product_id
JOIN opportunities o ON op.opportunity_id = o.id
WHERE o.stage = ''won''
  AND EXTRACT(YEAR FROM o.close_date) = 2024
GROUP BY p.id
ORDER BY total_quantity_sold DESC
LIMIT 1;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (80, 'Top 3 customers of 2023', 'SELECT a.id, a.name, SUM(op.amount) AS total_spent
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.stage =''won'' AND o.close_date BETWEEN ''2023-01-01'' AND ''2023-12-31''
GROUP BY a.id
ORDER BY total_spent DESC
LIMIT 3;', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (85, 'SELECT AVG(deal_size) as average_deal_size FROM sales WHERE customer_name = ''Langworth, Wuckert and Macejkovic''', 'SELECT AVG(op.amount) AS average_deal_size
FROM accounts a
JOIN opportunities o ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE a.name = ''Langworth, Wuckert and Macejkovic'';', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (89, 'details of the deal expected to close tomorrow', 'SELECT o.id AS opportunity_id, o.name AS opportunity_name, a.name AS account_name, o.stage, o.close_date
FROM opportunities o
LEFT JOIN accounts a ON o.account_id = a.id
WHERE o.close_date = CURRENT_DATE + INTERVAL ''1 day'' AND o.stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (94, 'total amount of deals expected to close this month', 'SELECT SUM(op.amount) AS total_amount_expected_this_month
FROM opportunities o
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.close_date >= ''2024-03-01'' AND o.close_date <= ''2024-03-31''
AND o.stage NOT IN (''won'', ''lost'');', false, NULL, NULL) ON CONFLICT DO NOTHING;
INSERT INTO public.query_examples VALUES (98, 'SELECT customer_name, deal_amount FROM deals WHERE expected_close_date = ''2024-03-22''', 'SELECT a.name AS customer_name, SUM(op.amount) AS deal_amount
FROM opportunities o
JOIN accounts a ON a.id = o.account_id
JOIN opportunity_product op ON o.id = op.opportunity_id
WHERE o.close_date = ''2024-03-22''
GROUP BY a.name;', false, NULL, NULL) ON CONFLICT DO NOTHING;



